def findPrev(curr):
    for i , val in enumerate(reversed(curr)):
        if val != 9:
            curr[-(i + 2)] -= 1
            # global j, pos, N
            num = 0
            while curr[-(i + num + 2)] < 0:
                if curr[-(1 + num)] == 9:
                    curr[-(i + num + 3)] -= 1
                    curr[-(i + num + 2)] = 9
                    curr[-(1 + num)] = 0
                    num += 1
                else:
                    curr[-(i + num + 3)] -= 1
                    curr[-(i + num + 2)] = curr[-(1 + num)] + 1
                    curr[-(1 + num)] = -1
                    num += 1
                
            if i != 0:
                curr[-1] -= 8 - curr[-(i + 1)] 
                curr[-(i + 1)] = 9
                
            else:
                curr[-(i + 1)] += 1
                
            if curr[-1] < 0:
                findPrev(curr)
            return


